import React from 'react';
import './Home.css'
import { Link } from 'react-router-dom'

function Home() {
  return (
    <div className='home' onDragStart={event => event.preventDefault()}>
      <div className='btn-container'>
        <Link to={{
          pathname: '/commands'
        }} target='_blank'>
          <button className='invite'>
            2020-11-18 정답확인
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
